import React, {Component} from 'react'
import logo from '../images/agiliad-logo.png'
import '../css/header.css';

export default class Header extends Component{
    constructor(props){
        super()
        this.state={
            employeeid :'',
            emoyeename :'',
            gender :'',
            skills :'',
            tools :'',
            domain :'',
            experience :0
        }
    }
    render(){
        return (
            <div className="header">
                <img className="logo" src={logo} alt="not found"></img>
                Employee Name :- {props.propObj.emoyeename} <br/>
                Employee Post :- {props.propObj.skills} <br/>
                Employee ID :- {props.propObj.emoyeeid} <br/>
            </div>
        )

    }
        
}
